import React from "react";
import UploaderStyled from "../styled/uploadStyled/UploaderStyled";

const Uploader = () => {
  return (
    <UploaderStyled>
      This is Uploader
      <input type="file" accept=".avi,.mp4,.mkv,.wmv,.mov"></input>
    </UploaderStyled>
  );
};

export default Uploader;
